import React, { useEffect, useState } from 'react';
import Logo from '../../imgs/nav-brand.png';
import useScrollPosition from '../../RainUI/useScrollPosition';
export default function Topbar() {
  const [scrolled,setScrolled] = useState(false);
  const position = useScrollPosition();
  const [active,setActive] = useState("home");
  useEffect(()=>{
    if (position == 0){
     if (scrolled) setScrolled(false);
    } else {

      if (!scrolled) setScrolled(true);
      var home = document.getElementById("homepage")?.getBoundingClientRect();
      var about = document.getElementById("about")?.getBoundingClientRect();
      var roadmap = document.getElementById("roadmap")?.getBoundingClientRect();
      var benefits = document.getElementById("benefits")?.getBoundingClientRect();
      var Team = document.getElementById("Team")?.getBoundingClientRect();
      if (home != null && about != null && roadmap != null && benefits != null && Team != null) {
      if (position >= home.top && position <= home.bottom){
            if (active != "home") setActive("home");
      }
      else if (position >= about.top && position <= about.bottom) {
            if (active != "about") setActive("about");
      }
      else if (position >= roadmap.top && position <= roadmap.bottom) {
          if (active != "roadmap") setActive("roadmap");
      }
      else if (position >= benefits.top && position <= benefits.bottom) {
        if (active != "benefits") setActive("benefits");
      }
      else if (position >= Team.top && position <= Team.bottom) {
        if (active != "team") setActive("team");
      }
      }
    }


  },[position]);

  return (
    <section className={`navbar-section ` + (scrolled ? "scrolled" : null)}>
        <nav className="phoenixbar">
                <img id="nav-brand" src={Logo}/>
                <div className="nav-content">
                    <div className="nav-links">
                        <a className={"" + (active == "homepage "? "homepage" : "")}id="nav-link">Home</a>
                        <a className={"" + (active ? "active" : "")} id="nav-link">About</a>
                        <a className={"" + (active ? "active" : "")} id="nav-link">RoadMap</a>
                        <a className={"" + (active ? "active" : "")} id="nav-link">PartnerShips</a>
                        <a className={"" + (active ? "active" : "")} id="nav-link">Team</a>
                        <a className={"" + (active ? "active" : "")} href="contactus.html">Contact Us</a>
                    </div>
                    <div className="nav-button-wrapper">
                        <button className=""></button>
                    </div>
                </div>

        </nav>

    </section>
  )
}
